  return (
    <>
      {/* <Header /> */}

      <button type="button" className="flex items-center justify-center m-auto text-sm text-white px-4 py-2 bg-green-400">
        <Link to={"/"}> Next {'>'} </Link>
      </button>
    </>
  )
}

